import { createRouter, createWebHistory } from 'vue-router';
import UserRegistrationComponent from '../components/UserRegistrationComponent.vue';
import BusinessInfoComponent from '../components/BusinessInfoComponent.vue';
import MenuComponent from '../components/MenuComponent.vue';
import ShareMenuComponent from '../components/ShareMenuComponent.vue';
import SharedMenuView from '../components/SharedMenuView.vue';

const routes = [
  {
    path: '/',
    redirect: '/register'
  },
  {
    path: '/register',
    name: 'Register',
    component: UserRegistrationComponent
  },
  {
    path: '/login',
    name: 'Login',
    component: UserRegistrationComponent
  },
  {
    path: '/business-info',
    name: 'BusinessInfo',
    component: BusinessInfoComponent
  },
  {
    path: '/menu',
    name: 'Menu',
    component: MenuComponent
  },
  {
    path: '/share-menu',
    name: 'ShareMenu',
    component: ShareMenuComponent
  },
  {
    path: '/menu/:menuId',
    name: 'SharedMenu',
    component: SharedMenuView
  }
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
